export function Footer() {
    return (
        <footer className="footer">
           <div className='about'>
            <h2>о компании</h2>
            <div className='links'>
                <a href="">Партнерская программа</a>
                <a href="">Вакансии</a>
            </div>
           </div>
           <div className='menu'></div>
           <div className='contacts'></div>
        </footer>
    )
}
